select id as "Job Id", district_name as "District Name", district_short_code as "Shortcode", status as "Status", created_at as "Created At", started_at as "Started At", 'Classlink' as "Source", EXTRACT(EPOCH FROM (completed_at - started_at)) as "Time to process" from jobs
WHERE
  $__timeFilter(created_at);

select id as "Job Id", district_name as "District Name", district_short_code as "Shortcode", status as "Status", created_at as "Started At", 'CSV' as "Source", EXTRACT(EPOCH FROM (ended_at - created_at)) as "Time to process" from jobs
WHERE
  $__timeFilter(created_at);

select id as "Job Id", district_name as "District Name", district_short_code as "Shortcode", status as "Status", created_at as "Created At",  started_at as "Started At", 'Clever' as "Source", EXTRACT(EPOCH FROM (completed_at - started_at)) as "Time to process"   from jobs
WHERE
  $__timeFilter(created_at);

select id as "Job Id", district_name as "District Name", district_short_code as "Shortcode", status as "Status", created_at as "Created At", started_at as "Started At", 'Classlink' as "Source", EXTRACT(EPOCH FROM (completed_at - started_at)) as "Time to process" from jobs
WHERE
  $__timeFilter(created_at) and (status='errored' OR status='aborted');

select id as "Job Id", district_name as "District Name", district_short_code as "Shortcode", status as "Status", created_at as "Started At", 'CSV' as "Source", EXTRACT(EPOCH FROM (ended_at - created_at)) as "Time to process" from jobs
WHERE
  $__timeFilter(created_at) and (status='errored');

select id as "Job Id", district_name as "District Name", district_short_code as "Shortcode", status as "Status", created_at as "Created At",  started_at as "Started At", 'Clever' as "Source", EXTRACT(EPOCH FROM (completed_at - started_at)) as "Time to process"   from jobs
